import React, { useState } from 'react';
import reactDom from 'react-dom';
import "./index.css";

const App = () => {
    
    
    const [name, setName] = useState("afiq");
    
    
    const ineve = (event) => {
        console.log(event.target.value);
        setName();
    }

  
    return(
        <>
            <div>
                <h1>Hellow {name} </h1>
                <input 
                type='text' 
                placeholder="Enter Your Name"
                onChange={ineve}/>
                <button>Submit</button>
            </div>
        </>

    );

}



export default App;
